import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function SignInPage() {
  const [FullName, setFullName] = useState('');
  const [Mobile, setMobile] = useState('');
  const [Email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [errorMessages, setErrorMessages] = useState({
    FullName: '',
    Mobile: '',
    Email: '',
    password: '',
  });

  const handleSubmit = (e) => {
    e.preventDefault();

    const isValid = validateInputs();

    if (isValid) {
      console.log('Form submitted:', {
        FullName,
        Mobile,
        Email,
        password,
      });

      // Redirect to a new page upon successful form submission
      // Replace '/newPage' with the desired route
      // You may want to use React Router's useHistory hook for programmatic navigation
    } else {
      console.log('Form submission failed. Please check the fields.');
    }
  };

  const validateInputs = () => {
    const nameRegex = /^[A-Za-z. ]{3,}$/;
    const mobileRegex = /^[9876][0-9]{9}$/;
    const emailRegex = /^[^\s@]+@[^\s@]+\.(com|in)$/;
    const passwordRegex = /^[A-Za-z.0-9!@#$%^&*]{8,}$/;

    let isValid = true;

    const validateField = (fieldName, value, regex, errorMessage) => {
      if (!value || (regex && !regex.test(value))) {
        setErrorMessages((prevErrors) => ({
          ...prevErrors,
          [fieldName]: errorMessage,
        }));
        isValid = false;
      } else {
        setErrorMessages((prevErrors) => ({ ...prevErrors, [fieldName]: '' }));
      }
    };

    validateField('FullName', FullName, nameRegex, 'Please enter a valid full name.');
    validateField('Mobile', Mobile, mobileRegex, 'Please enter a valid 10-digit mobile number.');
    validateField('Email', Email, emailRegex, 'Please enter a valid email address.');
    validateField(
      'password',
      password,
      passwordRegex,
      'Password must be at least 8 characters, contain at least one letter, one number, and one special character.'
    );

    return isValid;
  };

  return (
    <div className='org'>
      <h2>SignIn forher</h2>
      <form className='forinner container' onSubmit={handleSubmit}>
        <div className='form-group'>
          <label>Full Name <span style={{ color: 'red' }}>*</span> :</label>
          <input
            type='text'
            className='form-control'
            placeholder='ex: FullName'
            value={FullName}
            onChange={(e) => setFullName(e.target.value)}
          />
          <p className='error-message'>{errorMessages.FullName}</p>
        </div>

        <div className='form-group'>
          <label>Mobile <span style={{ color: 'red' }}>*</span> :</label>
          <input
            type='text'
            className='form-control'
            placeholder='ex: 9876543210'
            value={Mobile}
            onChange={(e) => setMobile(e.target.value.slice(0, 10))}
          />
          <p className='error-message'>{errorMessages.Mobile}</p>
        </div>

        <div className='form-group'>
          <label>Email <span style={{ color: 'red' }}>*</span> :</label>
          <input
            type='text'
            className='form-control'
            placeholder='ex: example123@gmail.com'
            value={Email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <p className='error-message'>{errorMessages.Email}</p>
        </div>

        <div className='form-group'>
          <label>Password <span style={{ color: 'red' }}>*</span> :</label>
          <span><input
            type='password'
            className='form-control'
            placeholder='ex: Abc@123'
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          /></span>
          <p className='error-message'>{errorMessages.password}</p>
        </div>

        {/* Use Link instead of a regular button */}
        <Link to='/TotalInfo' className='btn btn-success my-2'>
          Sign In
        </Link>

        {/* Display error messages */}
        {Object.values(errorMessages).map((error, index) => (
          <p key={index} className='error-message'>
            {error}
          </p>
        ))}
      </form>
    </div>
  );
}

export default SignInPage;
